import './ListViewer.css'

import { MdPerson, MdChatBubble } from 'react-icons/md';

function ListViewer() {
    return (
        <div id="listViewer">
            <div id="listWrap">

            </div>
            <div id="listSelectWrap">
                <button className='listSelectBtn'>
                    <MdPerson className='listIcon' />
                </button>
                <button className='listSelectBtn'>
                    <MdChatBubble className='listIcon' selectedIcon="true"/>
                </button>
            </div>
        </div>
    )
}

export default ListViewer;
